/* global Chart */
import $ from 'jquery'

/**
 * --------------------------------------------------------------------------
 * CoreUI Free Boostrap Admin Template (v2.1.15): main.js
 * Licensed under MIT (https://coreui.io/license)
 * --------------------------------------------------------------------------
 */

/* eslint-disable no-magic-numbers */
// random Numbers
const random = () => Math.round(Math.random() * 100)

// eslint-disable-next-line no-unused-vars
const lineChart = new Chart($('#canvas-1'), {
 type: 'line',
 data: {
 labels : ['January', 'February', 'March', 'April', 'May', 'June', 'July'],
 datasets : [
 {
 label: 'My First dataset',
 backgroundColor : 'rgba(220, 220, 220, 0.2)',
 borderColor : 'rgba(220, 220, 220, 1)',
 pointBackgroundColor : 'rgba(220, 220, 220, 1)',
 pointBorderColor : '#fff',
 data : [random(), random(), random(), random(), random(), random(), random()]
 },
 {
 label: 'My Second dataset',
 backgroundColor : 'rgba(151, 187, 205, 0.2)',
 borderColor : 'rgba(151, 187, 205, 1)',
 pointBackgroundColor : 'rgba(151, 187, 205, 1)',
 pointBorderColor : '#fff',
 data : [random(), random(), random(), random(), random(), random(), random()]
 }
 ]
 },
 options: {
 responsive: true
 }
})

// eslint-disable-next-line no-unused-vars
const barChart = new Chart($('#canvas-2'), {
 type: 'bar',
 data: {
 labels : ['January', 'February', 'March', 'April', 'May', 'June', 'July'],
 datasets : [
 {
 backgroundColor : 'rgba(220, 220, 220, 0.5)',
 borderColor : 'rgba(220, 220, 220, 0.8)',
 highlightFill: 'rgba(220, 220, 220, 0.75)',
 highlightStroke: 'rgba(220, 220, 220, 1)',
 data : [random(), random(), random(), random(), random(), random(), random()]
 },
 {
 backgroundColor : 'rgba(151, 187, 205, 0.5)',
 borderColor : 'rgba(151, 187, 205, 0.8)',
 highlightFill : 'rgba(151, 187, 205, 0.75)',
 highlightStroke : 'rgba(151, 187, 205, 1)',
 data : [random(), random(), random(), random(), random(), random(), random()]
 }
 ]
 },
 options: {
 responsive: true
 }
})

// eslint-disable-next-line no-unused-vars
const doughnutChart = new Chart($('#canvas-3'), {
 type: 'doughnut',
 data: {
 labels: ['Red', 'Green', 'Yellow'],
 datasets: [{
 data: [300, 50, 100],
 backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56'],
 hoverBackgroundColor: ['#FF6384', '#36A2EB', '#FFCE56']
 }]
 },
 options: {
 responsive: true
 }
})

// eslint-disable-next-line no-unused-vars
const radarChart = new Chart($('#canvas-4'), {
 type: 'radar',
 data: {
 labels: ['Eating', 'Drinking', 'Sleeping', 'Designing', 'Coding', 'Cycling', 'Running'],
 datasets: [
 {
 label: 'My First dataset',
 backgroundColor: 'rgba(220, 220, 220, 0.2)',
 borderColor: 'rgba(220, 220, 220, 1)',
 pointBackgroundColor: 'rgba(220, 220, 220, 1)',
 pointBorderColor: '#fff',
 pointHighlightFill: '#fff',
 pointHighlightStroke: 'rgba(220, 220, 220, 1)',
 data: [65, 59, 90, 81, 56, 55, 40]
 },
 {
 label: 'My Second dataset',
 backgroundColor: 'rgba(151, 187, 205, 0.2)',
 borderColor: 'rgba(151, 187, 205, 1)',
 pointBackgroundColor: 'rgba(151, 187, 205, 1)',
 pointBorderColor: '#fff',
 pointHighlightFill: '#fff',
 pointHighlightStroke: 'rgba(151, 187, 205, 1)',
 data: [28, 48, 40, 19, 96, 27, 100]
 }
 ]
 },
 options: {
 responsive: true
 }
})

// eslint-disable-next-line no-unused-vars
const pieChart = new Chart($('#canvas-5'), {
 type: 'pie',
 data: {
 labels: ['Red', 'Green', 'Yellow'],
 datasets: [{
 data: [300, 50, 100],
 backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56'],
 hoverBackgroundColor: ['#FF6384', '#36A2EB', '#FFCE56']
 }]
 },
 options: {
 responsive: true
 }
})

// eslint-disable-next-line no-unused-vars
const polarAreaChart = new Chart($('#canvas-6'), {
 type: 'polarArea',
 data: {
 labels: ['Red', 'Green', 'Yellow', 'Grey', 'Blue'],
 datasets: [{
 data: [11, 16, 7, 3, 14],
 backgroundColor: ['#FF6384', '#4BC0C0', '#FFCE56', '#E7E9ED', '#36A2EB']
 }]
 },
 options: {
 responsive: true
 }
})
"],"file":"charts.js"}
